31201=       Hollysys C это постав. по реше. передо. автоматиз. и инфор. технол. Китая. наш цель C "улуч. работу, жизнь и окруж. среду людей с помощ. автомат.", мы стрем. повы. эффек. произв. клие., улуч. каче. продук., обес. безопасн. произв. и улуч. усл. рабо.
31202=        Hollysys было основ. в 1993 г., в 2008 г. поступало на рынок в NASDAQ в Америке (HOLI). Hollysys стало междунаро. извес. марк. в обла. автомат. после поч. 20 лет устой. разв.. Основ. направ. деятельн. C автомат. проц., автомат. завода, автомат. рельсов. транспор..
31203=        Штаб-квартира груп. Hollysys наход. в Пекине, в насто. вре. имею. компа. и базы в город. Пекине, Ханчжоу, Сиань, Сингапуре и т.д., бол. 60 органи. обслу.  в стране и за рубеж., в Hollysys рабо. бол. 5000 служ. и рабо..
31204=      В области процессной автоматизации, промышленная система управления Hollysys успешно применяется в крупных проектах и ключевом технической установке, в том числе крупномасштабных киловаттах сверхкритических тепловых электростанций, 10-миллионных нефтеперерабатывающих заводах и в системе контроля и управления СКУ атомной электростанцией с мощьностю 1 млн. Квт. В производстве тепловой энергии, нефтехимии, тонкой химическрй промышленности, металлургических строительных материалах, пищевой промышленности и производстве напитков используется более 12 000 комплектов продуктов Hollysys  .
31205=        В обла. автомат. завода Hollysys собст. разрабо. мониторы движ. серии PLC и MC, кото. получ. сертифик. CE, UL и широко  исполь. в метро, шахте, нефтяном месторож., водообраб., контрол. промыш. обору..
31206=        В обла. автомат. рельсо. транспо. Hollysys разрабо. сигнал. сис. и проду., кото. получ. междунар. сертифик. безопасн. Сис. управ. безопасн. 350 км высокоскоро. железнодорож. поезда, сис. контр. крупномасшт. городс. рельсо. транспо. и дру. высокотехнол. продук. широко исполь. на рынке.
31207=      Hollysys - это признанный на национальном уровне корпоративный технологический центр, национальное инновационное предприятие и национальная отличная пост-докторская исследовательская станция. Он провел более 20 национальных крупных научно-технических проектов, таких как программа 863, и был награжден Национальной премией за достижения в области промышленности за десятилетия национальной комиссией по развитию и реформам ?Имеют независимые патенты на разработку продуктов и авторское право на программное обеспечение 200, из которых 35 патентов на изобретения; участие в разработке и формулировании ряда национальных стандартов, из которых 2011 год и проведенные по стандартам бельгийской железнодорожной отрасли, подготовленные этими тремя странами, стали национальным стандартом , И Hollysys растет как лидер и создатель правил в индустрии автоматизации.
31209=        В обла. автомат. и инфор. проду. и реше. Hollysys продол. улуч. каче. обслу. клие., предостав. сервис десяти тыс. клие. по всему миру, стрем. соз. макс. знач. для клие.

